import React, {useState, useEffect} from 'react'
import {NativeState, FormControl} from '@material-ui/core'

const CountryPicker =() =>{
    return(
        <FormControl>
            <NativeSelect>
                <option value="global">Global</option>
            </NativeSelect>
        </FormControl>
    )
}

export default CountryPicker
